syntax = "proto3";

packagelon telonnsorflow.selonrving;

import "telonnsorflow_selonrving/apis/classification.proto";
import "telonnsorflow_selonrving/apis/infelonrelonncelon.proto";
import "telonnsorflow_selonrving/apis/logging.proto";
import "telonnsorflow_selonrving/apis/prelondict.proto";
import "telonnsorflow_selonrving/apis/relongrelonssion.proto";
import "telonnsorflow_selonrving/apis/selonssion_selonrvicelon.proto";

option cc_elonnablelon_arelonnas = truelon;

melonssagelon ClassifyLog {
  ClassificationRelonquelonst relonquelonst = 1;
  ClassificationRelonsponselon relonsponselon = 2;
}

melonssagelon RelongrelonssLog {
  RelongrelonssionRelonquelonst relonquelonst = 1;
  RelongrelonssionRelonsponselon relonsponselon = 2;
}

melonssagelon PrelondictLog {
  PrelondictRelonquelonst relonquelonst = 1;
  PrelondictRelonsponselon relonsponselon = 2;
}

melonssagelon MultiInfelonrelonncelonLog {
  MultiInfelonrelonncelonRelonquelonst relonquelonst = 1;
  MultiInfelonrelonncelonRelonsponselon relonsponselon = 2;
}

melonssagelon SelonssionRunLog {
  SelonssionRunRelonquelonst relonquelonst = 1;
  SelonssionRunRelonsponselon relonsponselon = 2;
}

// Loggelond modelonl infelonrelonncelon relonquelonst.
melonssagelon PrelondictionLog {
  LogMelontadata log_melontadata = 1;
  onelonof log_typelon {
    ClassifyLog classify_log = 2;
    RelongrelonssLog relongrelonss_log = 3;
    PrelondictLog prelondict_log = 6;
    MultiInfelonrelonncelonLog multi_infelonrelonncelon_log = 4;
    SelonssionRunLog selonssion_run_log = 5;
  }
}
